import React, { Component } from "react";
import dayjs from "dayjs";
import axios from "axios";
import { toast } from "react-toastify";
import { Card, Button, CardImg, CardText, CardBody,
  CardTitle, CardSubtitle } from 'reactstrap';



const titleStyles = { fontWeight: "bold", padding: "10px 0" };

class Order extends Component {





  render() {
    const { items, customerName, tableOrPickup} = this.props;
    console.log(items);
    return (
      <Card>
          <CardImg top width="100%" src="https://placeimg.com/80/80/animals" />
          <CardBody>
            <CardTitle>
              {customerName}
            </CardTitle>
            <CardText>
              {items.map(item => <p>{`${item.items.name}`}</p>)}
            </CardText>
          </CardBody> 
          <Button label="Complete" />
          <Button label="Send SMS" />
      </Card>
  );
  }
}

export default Order;
